import React from 'react';
import '../../../../App.css';

const hour = (props) => {
    let imgSrc = props.setImg(props.weather);
        return (
            <div className="card hourCard">
                    <h3>{props.hour}</h3>
                    <p className="temperature">{props.temperature} C</p>
                    <img src={imgSrc} alt={props.weather} className="cityImg"/>             
                <div>
                <p>Brzina vjetra: <span>{props.windSpeed} km/h</span></p>
                <p>Mogućnost padavina: <span>{props.chanceOfRain} %</span></p>
                <p>Vlažnost vazduha: <span>{props.humidity} %</span></p>
                </div>
            </div>

        );
}

export default hour;
